import React from "react";
import "./App.css";

function App() {
  return (
    <div className="App">
      <div className="container">
        <h1>Weather App</h1>
        <Weather />
        <button className=" btn btn-primary">Hello</button>
        <footer>
          This website was coded by Mariia Stefaniuk, and is
          <br />
          <a
            href=" https://github.com/MaryStef92/weather-react"
            target="_blank"
          >
            open-sourced
          </a>
        </footer>
      </div>
    </div>
  );
}

export default App;
